import React from 'react';
import './index.css';

function Button(props) {
	return (
		<button className="blue-button">
			{object.hasOwnProperty(imagePath) ? <img src={imagePath}></img> : null}
			<label>{props.label}</label>
		</button>
	);
}

export default Button
